(16, 90, 'ข่าววันที่ 20 พฤศจิกายน 2564', '20-2564', '<hr />\r\n<p style=\"padding-left: 30px;\"><span style=\"font-family: arial, helvetica, sans-serif;\">เมื่อวันที่ 20 พฤศจิกายน 2564 ที่ผ่านมา <strong><span style=\"color: #0000ff;\">นายบรรจง ศรีบุรินทร์</span></strong> ประธานกลุ่มออมทรัพย์เพื่อการผลิตบ้านบางกะโด ได้เดินทางไปมอบเงินฌาปนกิจสมทบ จำนวน 36,078 บาท&nbsp;ให้กับผู้รับประโยชน์จากการเสียชีวิตของ<span style=\"color: #0000ff;\"><strong>นางสาวแตงอ่อน อ่างเหล็ก</strong></span> สมาชิกของกลุ่มฯ ณ บ้านสามเรือน อ.เมือง จ.ราชบุรี และร่วมเป็นเจ้าภาพสวดพระอภิธรรม</span></p>\r\n<hr />\r\n<p style=\"padding-left: 30px;\"><img src=\"images/news/N1_20NOV21/16170.jpg\" alt=\"16170\" width=\"500\" height=\"407\" style=\"display: block; margin-left: auto; margin-right: auto;\" /><img src=\"images/news/N1_20NOV21/16462.jpg\" alt=\"16462\" width=\"500\" height=\"577\" style=\"display: block; margin-left: auto; margin-right: auto;\" /><span style=\"font-family: arial, helvetica, sans-serif;\"></span></p>', '', 1, 11, '2021-12-16 15:59:52', 747, '', '2021-12-16 16:00:30', 747, 0, '0000-00-00 00:00:00', '2021-12-16 15:59:52', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_